import React from 'react'   
import './expenses.css'
import NewExpense from './New Expenses/NewExpense'


const Expenses = (props) => {
  let data
    const getDataFromNewExpense = (prevData) => {
      data = {
        ...prevData
      }
      props.expense(data)
       console.log("FROM EXEPENSEj.s", data)
    }
   
  return (
    <div className='expenses'>
      
    <NewExpense onSavedData={getDataFromNewExpense}/>
    </div>
  )
}
export default Expenses
